message:
RESUMO DO DISCURSO do Bolsomito, hoje, 9/12/22d Confirmou que ele é o chefe das FFAA;
- FFAA são unidas;
- Liberdade é mais importante que a Vida;
- Não critiquem sem saber o que está acontecendo;
- Todos sabemos o que ocorreu nestes 4 anos;
- Estamos lutando até pela Liberdade daqueles que nos criticam;
- Pq Deus me colocou nesta cadeira? Pergunto a Ele
- Temos um país fantástico;
- Está falando sobre uma reunião que aconteceu com o STF;
- Quem decide minha vida são vcs; Só sou feliz se vcs tb forem;
- Qual o futuro do Brasil? Pq chegamos a este ponto? Demoramos a acordar? Sempre há tempo;
- Sou exatamente como vcs, corpo e alma;
- Este momento não é fácil - estou a 40 dias calado;
- Arrisquei minha vida para estar no meio de vcs, como em Juiz de Fora;
- Tudo que fiz foi pela minha pátria;
- Agradeço a Deus pela oportunidade de estar aqui;
- Vencemos os desafios, com pandemia. O Brasil está pronto para dar um salto;
- Nada está perdido;
- Nunca saí das 4 linhas e acredito que a vitória será tb desta maneira;
- Dou minha vida pela Pátria;
- Vcs estáo aqui pelo país - não por mim;
- Vamos nos unir, buscar alternativas;
- Todos temos família e não podemos esperar chegar lá na frente e dizer: o que não fiz lá trás que poderia ter feito;
- Vamos fazer a coisa certa - Vamos vencer;
- Tudo dará certo no momento oportuno.

